import React from "react";
import ReactDOM from "react-dom";

import "./index.css";
import App from "./App";
import AuthContext from "./components/store/auth-context";

ReactDOM.render(
  <AuthContext>
    <App />
  </AuthContext>,
  document.getElementById("root")
);
